import React from 'react';
import './HeaderOption.css'

function HeaderOption({Icone, title}) {
  return <div className='headerOption'>
    {Icone && <div className='headerOption__icone'/>}
    <h3 className='headerOption__'>{title}</h3>
  </div>;
}

export default HeaderOption;
